using System;
using System.Collections.Generic;
using System.Linq;
using System.Windows;
using System.Windows.Controls;
using Chef.Models;
using Chef.Models.Database;
using Chef.Models.Entities;
using Chef.Shared;
using Chef.ViewModels;
using Microsoft.EntityFrameworkCore;

namespace Chef
{
    /// <summary>
    /// Interaction logic for MainWindow.xaml
    /// </summary>
    public partial class MainWindow : Window
    {
        private readonly DatabaseContext databaseContext;
        private readonly RecipeService recipeService;
        private readonly ViewModelFactory viewModelFactory;
        private int dbLength = 5;
        public MainWindow(DatabaseContext databaseContext,
                          RecipeService recipeService,
                          ViewModelFactory viewModelFactory)
        {
            this.databaseContext = databaseContext;
            this.recipeService = recipeService;
            this.viewModelFactory = viewModelFactory;

            InitializeComponent();
            this.checkDatabase();
        }

        private void Button_Click(object sender, RoutedEventArgs e)
        {
            List<Product> products = databaseContext.Products.ToList();
            foreach (Product product in products)
            {
                MessageBox.Show(product.Name);
            }
        }

        private void generateTestEntity()
        {
            this.databaseContext.Products.RemoveRange(this.databaseContext.Products);
            this.databaseContext.Products.Add(Product.create("Tomato", "12.1", "12.1"));
            this.databaseContext.Products.Add(Product.create("Cucumber", "15.1", "3"));
            this.databaseContext.SaveChanges();
        }

        private void createTestEntities_Click(object sender, RoutedEventArgs e)
        {
            this.generateTestEntity();
            this.generateRecipe();

        }

        private void generateRecipe()
        {
            RecipeEntity recipe = new RecipeEntity
            {
                Name = "recipe 1",
                Calories = 1000,
                Carbohydrate = 100,
                Description = "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.",
                Fats = 100,
                Proteins = 100,
                Ingredients = new List<Ingredient>
                {
                    new Ingredient { Name = "Tomato", Quantity = 10},
                },
                Images = new List<DbImage>
                {
                    new DbImage
                    {
                        Content = ""
                    }
                }
            };

            //this.databaseContext.Recipes.Add(recipe);
            this.recipeService.deleteRecipe(4);
            this.databaseContext.SaveChanges();
        }

        private void checkDatabase()
        {
            var result = SqlHelper.getDatabasesCount();
            if (result < this.dbLength)
            {
                try
                {
                    this.databaseContext.Database.EnsureDeleted();
                    this.databaseContext.Database.Migrate();
                } catch
                {
                    MessageBox.Show("Some database error");
                }
            }
        }

        private void addRecipe_Click(object sender, RoutedEventArgs e)
        {
            this.Content = new Frame { Content = this.viewModelFactory.createRecipeAddPage() };
        }
        private void warehouse_Click(object sender, RoutedEventArgs e)
        {
            this.Content = new Frame { Content = this.viewModelFactory.createWarehousePage() };
        }
    }
}
